import '../Nav/Nav.css';
import React from 'react';
import { NavLink, useLocation } from 'react-router-dom';
// import Login from '../../pages/Login/Login';

const Nav = () => {
const location = useLocation();

    return (
        <nav>
            <div className="Nav">
                <ul><li><NavLink to='/Login'>Home &gt; Login</NavLink></li></ul>
                <ul><li><NavLink to='/Mypage'>Home &gt; Mypage</NavLink></li></ul>
                <ul><li><NavLink to='/Order'>Home &gt; Order</NavLink></li></ul>
                <ul><li><NavLink to='/Cart'>Home &gt; Cart</NavLink></li></ul>
                <ul><li><NavLink to='/Qna'>Home &gt; Qna</NavLink></li></ul>
                <ul><li><NavLink to='/Store'>Home &gt; Store</NavLink></li></ul>
            </div>
        </nav>
    );
}

export default Nav;
